import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap/Card';

const Footer = () => {
    return (
        <Card>
      <Card.Header as="h5">SurveysApp!</Card.Header>
      <Card.Body>
        <Card.Title>Contact:</Card.Title>
        <Card.Text>
          
        </Card.Text>
      </Card.Body>
    </Card>
    )
}
export default Footer;
